const Header = () => {
  return (
    <header className=" h-8 md:h-10 w-full bg-gray-700 text-cyan-400 fixed">
      <div className="h-full container mx-auto flex items-center justify-center">
        <div className="h-full w-auto mx-4 md:mx-8 flex items-center justify-center">
          <div>logo</div>
          <div className="mx-2 md:4">lovelybird</div>
        </div>
        <div className="mx-2 md:mx-4">
          <ul className="list-none flex items-center justify-center mr-5">
            <li>Home</li>
            <li>Photo Servies</li>
            <li>Hole Dectraction</li>
            <li>DJ</li>
            <li>Contact</li>
          </ul>
        </div>
      </div>
    </header>
  );
};

export default Header;
